column8:
ジュリアラグジュのリトルシリーズ。<br>
小さめで、ショートネイルにも、夏のＦＯＯＴネイルにも活躍します。又、ジュリアラグジュとリトルを組み合わせたデコレーションもラグジュアリーな仕上がりになります。<br>
<br>
【カラー】アンピンキュ<br>
【サイズ】約13×１０ｍｍ<br>
【内容量】２Ｐ<br><br><style>
* {
margin:0px;
padiing:0px;
}
body.noMargin{
	margin:0px;
	padding:0px 0px 0px 0px;
	font-size:100%;
	color:#666666;
	font-size:12px;
}
div.leftItem{
padiing:5px;
	margin-bottom:10px;
	width:628px;
	border:6px solid;
	color:#EEEEEE;
}
.sitemap-tree {
margin:12px 12px 12px 12px;
}
.sitemap-tree ul {
padding:0px;
}

.sitemap-tree p {
	padding-bottom:10px;
	font-size:11px;
	color:#666666;
	line-height:125%;
}

.sitemap-tree .attent{
	padding-bottom:10px;
	font-size:11px;
	color:#FF00AA;
	line-height:125%;
}

.sitemap-tree img {
	margin: 10px 0px;
}

.sitemap-tree ul li a{
	font-size:12px;
	color:#666666;
}

.sitemap-tree ul li a:hover{
	color:#ffcccc;
}

a:link{text-decoration:none;}

a:hover img {
	filter: alpha(opacity=60);
	-moz-opacity: 0.60;
	opacity: 0.60;
}

.brand_link{
	width:640px;
	height:800px;
	margin-bottom:10px
}

.rank_link{
	width:710px;
	height:4000px;
	margin-bottom:10px
}

.copy{
	padiing:10px;
	margin-bottom:10px;
	width:628px;
	border:6px solid;
	color:#EEEEEE;
	float: right;
	margin-top: 10px;
	background-color: #353535;
}

.copy .p{
	padiing:30px;
}

.caution{

	margin-bottom:10px;
	background-color: #BFDED6;
	padding:10px;
}

.cautionArea{
	border:1px solid;
	border-color: #DDDDDD;
padding:10px;

	background-color: #FFFFFF;
	line-height:125%;
}

.cautionArea p{
	font-size:85%;
	color:#666666;;
	line-height:125%;
}

.cautionArea .attent{
	padding-bottom:10px;
	font-size:85%;
	color:#FF00AA;
	line-height:125%;
}

p.kouseki{
	font-size:90%;
	color:#666666;
	line-height:140%;
	margin:3px auto 10px auto;
	text-align:left;
}
table.kouseki{
	width:638px;
	background-color:#999999;
	margin:0px auto 0px auto;
}
table.kouseki caption{
 text-align:left;
 font-size:70%;
 color:#666666;
}
table.kouseki th{
	width:160px;
	background-color:#EEEEEE;
	color:#666666;
	font-size:70%;
	text-align:left;
	padding:3px 10px;
	font-weight:normal;
}
table.kouseki td{
	width:478px;
	background-color:#FFFFFF;
	color:#666666;
	font-size:70%;
	padding:3px 5px;
	line-height:160%;
	text-align:left;
}



</style>

<body class="noMargin">
<div class="caution">

<div class="cautionArea">
<p class="attent">ご注文前にご確認下さいませ。</p>
<p>※お客様のモニター環境により、
写真と実物の色が異なって見える場合がございます。
<br>
※在庫状況によりメーカーよりお取り寄せとなる場合がございます。</p>
</div>
</div>
